package fr.irisa.triskell.sintaks.printer;

public class PrinterSemanticException extends Exception {

	public PrinterSemanticException() {
		super();
	}

	public PrinterSemanticException(String message) {
		super(message);
	}

	public PrinterSemanticException(String message, Throwable cause) {
		super(message, cause);
	}

	public PrinterSemanticException(Throwable cause) {
		super(cause);
	}

	private static final long serialVersionUID = 1L;
}
